static int
parser_yyinput_single_line (char *buff, int max_size)
{
  int c, end;
  int i = 0;

  assert (max_size >= 1);
  do
    {
      if (str_identifier == '\'' || str_identifier == '\"')
        {
	  c = str_identifier;
        }
      else
        {
	  c = pt_nextchar ();
        }

      if (c == '\'' || c == '\"')	/* string start */
	{
          if (str_identifier != '\'' && str_identifier != '\"')
	    {
              str_identifier = c;   
	      buff[i++] = c;
	      if (i >= max_size)
	        {
	          return i;
	        }
	    }
	    end = c;

	  do
	    {
	      c = pt_nextchar ();
	      if (c == end)	/* string end */
		{
		  str_identifier = '\0';	
		  break;
		}

	      buff[i++] = c;
	      if (i >= max_size)
		{
		  return i;
		}

	      if (c == '\\'
		  && (prm_get_bool_value (PRM_ID_NO_BACKSLASH_ESCAPES) == false))
		{
		  /* if escape character */
		  c = pt_nextchar (); /* read one more */
		  buff[i++] = c;
		  if (i >= max_size)
		    {
		      return i;
		    }
		}
	    }
	  while (c != -1);
	}

      if (c == ';')
	{
	  buff[i++] = -1;
	  buff[i] = 0;
	  return i;
	}

      buff[i++] = c;
      if (i >= max_size)
	{
	  return i;
	}

    }
  while (c != -1);

  buff[i] = 0;
  parser_yyinput_single_mode = 0;	/* all done */

  /* end of file */
  str_identifier = '\0';

  return i;
}

static int
parser_yyinput_multi_line (char *buff, int max_size)
{
  int c;
  int i = 0;

  assert (max_size >= 1);
  for (;;)
    {
      c = pt_nextchar ();
      if (c == -1)
	{
	  buff[i] = 0;
	  return i;
	}

      buff[i++] = c;
      if (i == max_size)
	{
	  buff[i] = 0;
	  return i;
	}
    }
}

